import './style.css'
import { Outlet, Link } from "react-router-dom";
import React, { useEffect, useState} from 'react';
import api from '../api/api'

const Body = () => {
    const [data, setData] = useState([[]]);
    useEffect(() => {
        api.getMovies().then((json)=> {console.log(json.result);setData(json.result);})

    }, []);



    return(
        <div className="container">
        <div className="pt-5 row product-list">
        {
                  data.map((product, i) =>
                      <InsertMOvie title={product.title} price={product.price} img={product.img} COLOR={product.COLOR} id={product.product_id} key={i}/>
        )}      
        </div>  

      </div>    
    ) 
}
export default Body;
